import React from 'react';
import Logo from '../../img/logo12123.png';
import classes from "./Header.module.css";

const Header = () => {
    return (
        <header className={classes.header}>
            <div>
                <img src={Logo} alt=""/>
                <p>ProSearch</p>
            </div>
            <div></div>
            <div></div>
            <div></div>
        </header>
    );
};

export default Header;
